  input: 'TEXT,F3XN,,"Several reported disbursements, in this Report, for postage
    paid to Mail Handling, Inc., all dated 10-29-2002 on Schedules E in this Report
    are correcting previously reported amounts on 24 Hour Notices filed in late October
    and early November.  These are corrected as to amounts and vendor.  The previously
    reported vendors were Mail Handling, Inc and Shakopee Valley Printing, all should
    have been Mail Handling, Inc.  These amounts are corrected now for actual amounts
    paid and the 24 Hour Notices were based on estimates.  Accounts payble in this
    report still include amounts reported as estimates on these previously reporterd
    24 Hour Notices and will be corrected by amendment to this Report, once invoices
    are received, allocated and paid; or we will correct these Reports on our 12-31-2002
    year-end Report, as appropriate. Candidates effected are: Norm Coleman, US Senate,
    Gill Gutknecht, 1st Congressional District, John Kline, 2nd Congressional District,
    Mark Kennedy, 6th Congressional District, Collin Peterson, 7th Congressional District,
    all of Minnesota."'
